{"9": ["Изначально, пришёл  недокомплект.Написала в службу  поддержки, и к моему  удивлению,  вскоре, в почтовом  ящике я обнаружила письмо, с недостающими  элементами!!!\nТак что все элементарное просто, и все решаемо!\nСпасибо!!!!\nP.s. нужно  позаботиться  о качестве  упаковки, там где спайка, они  попросту  расклееваются, и получается  такая  ситуация,  видимо  водители  доставки  теперь  играют  ими)))", "2021-04-16T05:52:42Z", "", "0", 1, 0, 5, "Mag-rus Набор \"Кто где живет? Ассоциации\"", "АНДАНТЕ"], "10": ["Прошло целым, соответствует описанию.\nДа, магниты немного \"гнутые\" но это не критично руками можно скорректировать изгиб :-) в обратную сторону.\nРисунки яркие, ребенку нравится.\nУпаковка без повреждений", "2021-04-12T06:55:14Z", "", "0", 1, 0, 5, "Mag-rus Набор \"Кто где живет? Ассоциации\"", "АНДАНТЕ"], "11": ["Давно уже купила эти магниты для работы в детском саду. Сейчас только открыла и оказалось что комплект далеко не полный. Открывайте при получении и всё проверяйте. Деньги на ветер. И занятие не получится провести. Очень расстроена!", "2021-04-06T16:17:00Z", "", "0", 2, 0, 1, "Mag-rus Набор \"Кто где живет? Ассоциации\"", "АНДАНТЕ"], "30": ["Картинки яркие, красивые. Но пришли изогнутые, поэтому сняла звезду. Сынок охотно повторяет кто где живёт.", "2021-03-13T16:56:23Z", "синий, зеленый, красный", "0", 1, 0, 4, "Mag-rus Набор \"Кто где живет? Ассоциации\"", "АНДАНТЕ"], "35": ["Купили не себе, не распечатываю. Пришли вот такие.", "2021-03-10T14:17:25Z", "srv_ids\":[]}]\nеленый, красный", "0", 1, 0, 5, "Mag-rus Набор \"Кто где живет? Ассоциации\"", "АНДАНТЕ"], "38": ["Набор хороший, своих денег стоит. магниты тонки, магнитятся хорошо.", "2021-03-07T14:09:03Z", "синий, зеленый, красный", "0", 1, 0, 5, "Mag-rus Набор \"Кто где живет? Ассоциации\"", "АНДАНТЕ"], "42": ["Яркие.\nНо все мятые от магнитной доски отваливаются, и фиг их выровнять получается...", "2021-03-01T17:54:57Z", "синий, зеленый, красный", "0", 1, 0, 2, "Mag-rus Набор \"Кто где живет? Ассоциации\"", "АНДАНТЕ"], "43": ["Магниты классные!", "2021-03-01T10:39:20Z", "less_delivery\":false},\"srv_ids\":[],\"site\":", "0", 1, 0, 5, "Mag-rus Набор \"Кто где живет? Ассоциации\"", "АНДАНТЕ"], "44": ["Хорошие магниты яркие не мелкие 24 шт пересчитала сразу на месте!!!", "2021-03-01T08:56:52Z", "синий, зеленый, красный", "0", 1, 0, 5, "Mag-rus Набор \"Кто где живет? Ассоциации\"", "АНДАНТЕ"], "46": ["Товар пришел в открытом пакетике. Как ни странно, но все магниты на месте. Поэтому не снижаю оценку. Сами магнитики хорошие, яркие. Некоторые не прилегали хорошо к холодильнику, топорщились, падали. Но прочитала в отзывах про утюг. Решила проверить. Тоже прогладила через бумажные полотенца. И сразу на холодильник - результат порадовал, все ровненькие, держатся отлично, не падают.", "2021-02-28T16:02:26Z", "синий, зеленый, красный", "0", 1, 0, 5, "Mag-rus Набор \"Кто где живет? Ассоциации\"", "АНДАНТЕ"], "47": ["Отличные магниты,яркие и хорошо держатся. Пришли в полном составе. Спасибо.", "2021-02-28T05:50:12Z", "синий, зеленый, красный", "0", 1, 0, 5, "Mag-rus Набор \"Кто где живет? Ассоциации\"", "АНДАНТЕ"], "51": ["Хорошие .все в порядке.", "2021-02-24T16:01:50Z", ":false},\"srv_ids\":[],\"site\":\"RU\"}]\n�ный", "0", 1, 0, 5, "Mag-rus Набор \"Кто где живет? Ассоциации\"", "АНДАНТЕ"], "52": ["Очень долго шли. Пришли без какой либо упаковки в дырявом пакете. Мятые. ", "2021-02-24T13:41:47Z", "синий, зеленый, красный", "0", 1, 0, 3, "Mag-rus Набор \"Кто где живет? Ассоциации\"", "АНДАНТЕ"], "55": ["Долго доставляли набор. Но это полбеды. Пришла не полная комплектация с повторами!!!! ", "2021-02-24T06:09:19Z", "синий, зеленый, красный", "0", 1, 0, 5, "Mag-rus Набор \"Кто где живет? Ассоциации\"", "АНДАНТЕ"], "57": ["Пришло целым", "2021-02-20T15:35:42Z", "синий, зеленый, красный", "0", 1, 0, 5, "Mag-rus Набор \"Кто где живет? Ассоциации\"", "АНДАНТЕ"], "60": ["Изогнутые, не очень держаться на холодильнике, но за свою цену норм", "2021-02-16T17:03:07Z", "livery\":false},\"srv_ids\":[]}]\nрасный", "0", 2, 0, 4, "Mag-rus Набор \"Кто где живет? Ассоциации\"", "АНДАНТЕ"], "61": ["Ещё не открывала, в подарок... Размеры - на фото. На вид хорошие", "2021-02-16T13:50:38Z", "синий, зеленый, красный", "0", 1, 0, 5, "Mag-rus Набор \"Кто где живет? Ассоциации\"", "АНДАНТЕ"], "63": ["Хорошенькие и цена приятная, для разнообразия норм! Немного изогнуты, но это поправимо , упаковка целая была все на месте.", "2021-02-14T18:33:54Z", "синий, зеленый, красный", "0", 1, 0, 5, "Mag-rus Набор \"Кто где живет? Ассоциации\"", "АНДАНТЕ"], "65": ["Очень милые магнитики. Немного беспокоит паук-инвалид на 6 лапах. Ну мы делаем вид, что он две лапки спрятал за спину)), скворец похож на воробья, и пока дочь читать не умеет, у нас это воробей. В 1,5 года можно допустить. \nМагниты пришли весьма гнутые, расправить под тяжёлой книгой не получилось. Рискнула пройти утюгом на двоечку через бумажные салфетки, и горячие сразу на стенку холодильника, результат порадовал. \nНабор содержательный, за свою цену просто отлично!\nУпаковка не удачная, проверяйте комплектацию при получении. С этим набором повезло, брала другой, там половина отсутствовала.", "2021-02-10T10:18:20Z", "синий, зеленый, красный", "0", 7, 0, 5, "Mag-rus Набор \"Кто где живет? Ассоциации\"", "АНДАНТЕ"], "67": ["Приобрела за 178р. Магниты пришли изогнутые, пришлось выпрямлять. В целом, к качеству претензий нет. Ребёнок доволен, а это главное! ", "2021-02-08T22:06:56Z", "синий, зеленый, красный", "0", 1, 0, 5, "Mag-rus Набор \"Кто где живет? Ассоциации\"", "АНДАНТЕ"], "69": ["Были огорчены. Из 24 элементов, 5 элементов не хватает. На пункте не обратили внимание, на то, что пакет был заклеен с верху белым скотчем. Товар не дорогой всего 136 рублей. Но имидж компании уже падает. Товары приходят к клиенту либо не тот, либо вскрытый и не полный.  Печально, что у вас работают такие не добросовестные сотрудники.", "2021-02-07T08:41:31Z", "синий, зеленый, красный", "0", 1, 0, 5, "Mag-rus Набор \"Кто где живет? Ассоциации\"", "АНДАНТЕ"], "70": ["Красивые яркие магниты. Пришли аккуратно запечатанными в пакет.", "2021-02-06T13:22:24Z", "синий, зеленый, красный", "0", 2, 0, 5, "Mag-rus Набор \"Кто где живет? Ассоциации\"", "АНДАНТЕ"], "73": ["Магниты красивые. Правда сама упаковка порвалась пока до дома несли.", "2021-02-03T12:24:02Z", "синий, зеленый, красный", "0", 1, 0, 4, "Mag-rus Набор \"Кто где живет? Ассоциации\"", "АНДАНТЕ"], "74": ["Пришёл полный комплект, магниты не плохие, но грязные, мятые, при чём на некоторых красные пятнышки и разводы, будто кровь 😏 и потом ещё рыбку обнаружили отклеивающуюся 😬 хотя за такую цену, я наверное придираюсь 🤭😅", "2021-02-02T13:44:31Z", "синий, зеленый, красный", "0", 1, 0, 3, "Mag-rus Набор \"Кто где живет? Ассоциации\"", "АНДАНТЕ"], "76": ["Магнитики понравились, крепятся хорошо. Сами яркие, красивые", "2021-01-31T08:46:48Z", "синий, зеленый, красный", "0", 2, 0, 5, "Mag-rus Набор \"Кто где живет? Ассоциации\"", "АНДАНТЕ"], "79": ["Упаковка пришла порвана, детали очень помятые 😰 из-за этого плохо держаться и на  доске , и на холодильнике 🙁  А так пазлы неплохие .Ребёнок 3-х лет  быстро понял, что к чему! Быстро собрали 😉  ", "2021-01-26T22:35:33Z", "srv_ids\":[]}]\nеленый, красный", "0", 2, 0, 3, "Mag-rus Набор \"Кто где живет? Ассоциации\"", "АНДАНТЕ"], "80": ["Это вообще как???? А где остальные???", "2021-01-25T10:37:48Z", "синий, зеленый, красный", "0", 1, 0, 1, "Mag-rus Набор \"Кто где живет? Ассоциации\"", "АНДАНТЕ"], "81": ["Хорошие магниты. Яркие. На магнитную доску липнут хорошо. Интересно заниматься.", "2021-01-24T20:25:51Z", "синий, зеленый, красный", "0", 2, 0, 5, "Mag-rus Набор \"Кто где живет? Ассоциации\"", "АНДАНТЕ"], "85": ["Мне показались мелковаты.... И почему то слон оказался меньше чем паук🤷🏻‍♀️🤣😆  хотя соотношение цены и качества наверное нормальное.", "2021-01-22T18:34:22Z", "синий, зеленый, красный", "0", 1, 0, 4, "Mag-rus Набор \"Кто где живет? Ассоциации\"", "АНДАНТЕ"], "86": ["Где остальные магниты??? Заказывала только ради лягушки и пчёлки, в итоге из нет, и ещё половины магнитов тоже! Ужас. Не рекомендую ", "2021-01-22T17:00:55Z", "синий, зеленый, красный", "0", 1, 0, 1, "Mag-rus Набор \"Кто где живет? Ассоциации\"", "АНДАНТЕ"], "87": ["Мне пришло 11!!!!! Магнитов !!! Не хватает почти половины ! ", "2021-01-22T10:57:45Z", "синий, зеленый, красный", "0", 2, 0, 1, "Mag-rus Набор \"Кто где живет? Ассоциации\"", "АНДАНТЕ"], "89": ["Скворца не положили в упаковку,очень жаль", "2021-01-20T06:40:15Z", "ids\":[]}]\n, зеленый, красный", "0", 1, 0, 4, "Mag-rus Набор \"Кто где живет? Ассоциации\"", "АНДАНТЕ"], "97": ["Все понравилось, ребенок сразу стал играть и вешать на доску магнитную", "2021-01-11T17:01:48Z", "синий, зеленый, красный", "0", 1, 0, 5, "Mag-rus Набор \"Кто где живет? Ассоциации\"", "АНДАНТЕ"], "100": ["Магниты просто прекрасные. Ребёнок 1,5 года обожает их . НО!!!!! Закалывала несколько разных наборов, ни один не пришёл полно комплектным. Это очень печально! Упаковки всегда рваные, качество упаковки оставляет желать лучшего.  Обидно до ужаса. ", "2021-01-02T15:00:34Z", "синий, зеленый, красный", "0", 1, 0, 3, "Mag-rus Набор \"Кто где живет? Ассоциации\"", "АНДАНТЕ"], "102": ["Набор не плохой, но тоже \"порадовал\" воробей под названием скворец..", "2020-12-29T15:06:17Z", "синий, зеленый, красный", "0", 5, 0, 4, "Mag-rus Набор \"Кто где живет? Ассоциации\"", "АНДАНТЕ"], "105": ["Сняла звёзду за некоторую карикатурность изображений.  В целом неплохие. Ребенку нравится.", "2020-12-19T05:53:41Z", "синий, зеленый, красный", "0", 3, 1, 3, "Mag-rus Набор \"Кто где живет? Ассоциации\"", "АНДАНТЕ"], "110": ["Хорошие. Упакованы, яркие. Крупные, в ширине тонкие. Воробей написано скворец", "2020-12-10T10:44:58Z", "синий, зеленый, красный", "0", 2, 0, 5, "Mag-rus Набор \"Кто где живет? Ассоциации\"", "АНДАНТЕ"], "111": ["Магниты большие и яркие. Очень понравились. Покупкой довольна.", "2020-12-10T10:34:54Z", "синий, зеленый, красный", "0", 1, 0, 5, "Mag-rus Набор \"Кто где живет? Ассоциации\"", "АНДАНТЕ"], "113": ["Яркие, хорошие! Рекомендую! \nP. S. На фото 2 набора разных", "2020-12-06T18:42:12Z", "синий, зеленый, красный", "0", 1, 0, 5, "Mag-rus Набор \"Кто где живет? Ассоциации\"", "АНДАНТЕ"], "116": ["Очень обидно. 5 магнитов нет!!!!!!", "2020-11-26T01:44:42Z", "синий, зеленый, красный", "0", 1, 0, 1, "Mag-rus Набор \"Кто где живет? Ассоциации\"", "АНДАНТЕ"], "117": ["Не хватает 5 магнитов. Магниты все помятые", "2020-11-29T09:17:16Z", "синий, зеленый, красный", "0", 1, 0, 1, "Mag-rus Набор \"Кто где живет? Ассоциации\"", "АНДАНТЕ"], "118": ["Ужас магнитов мало и ещё не те", "2020-11-28T10:41:08Z", "синий, зеленый, красный", "0", 1, 0, 3, "Mag-rus Набор \"Кто где живет? Ассоциации\"", "АНДАНТЕ"], "119": ["Соответствует описанию. Магниты держат хорошо, размер не маленький,цвета яркие. Ребенку 1,6 нравится играть.", "2020-11-27T07:04:08Z", "синий, зеленый, красный", "0", 1, 0, 5, "Mag-rus Набор \"Кто где живет? Ассоциации\"", "АНДАНТЕ"], "121": ["Назвать воробья скворцом это конечно не криминал, но эти же магниты делал не ребёнок...", "2020-11-26T06:26:58Z", "синий, зеленый, красный", "0", 3, 0, 4, "Mag-rus Набор \"Кто где живет? Ассоциации\"", "АНДАНТЕ"], "122": ["Классные магниты.Но я почему-то думала,что они друг к другу прилепают", "2020-11-25T12:20:20Z", "синий, зеленый, красный", "0", 1, 0, 5, "Mag-rus Набор \"Кто где живет? Ассоциации\"", "АНДАНТЕ"], "123": ["Магнитики замечательные. Покупала в подарок. Покупкой довольна.", "2020-11-23T19:58:34Z", "синий, зеленый, красный", "0", 1, 0, 5, "Mag-rus Набор \"Кто где живет? Ассоциации\"", "АНДАНТЕ"], "140": ["Ооочень понравились магниты. Не первый раз берём уже этого производителя. Набор алфавит в коробочке просто прекрасен, ребенок в 1,5 года знает уже все буквы и слова на них", "2020-10-27T14:56:49Z", "синий, зеленый, красный", "0", 1, 0, 5, "Mag-rus Набор \"Кто где живет? Ассоциации\"", "АНДАНТЕ"], "141": ["Хороший развивающий набор. Только очень тонкие магнитики. У меня от старшего подобный набор есть, там они толще и ребёнок легко их одевает и снимает с холодильника. А этот одевается легко, а вот снять их с холодильника проблема. Взяла за 200 руб. ", "2020-10-27T13:10:57Z", "синий, зеленый, красный", "0", 1, 0, 5, "Mag-rus Набор \"Кто где живет? Ассоциации\"", "АНДАНТЕ"], "142": ["Половины магнитов нет. Возврат", "2020-10-27T11:39:07Z", "синий, зеленый, красный", "0", 0, 1, 1, "Mag-rus Набор \"Кто где живет? Ассоциации\"", "АНДАНТЕ"], "143": ["Пришёл пустой пакет, очень расстроились", "2020-10-24T08:06:31Z", "синий, зеленый, красный", "0", 0, 1, 1, "Mag-rus Набор \"Кто где живет? Ассоциации\"", "АНДАНТЕ"], "144": ["Все целое, не помятое", "2020-10-20T17:38:54Z", "синий, зеленый, красный", "0", 1, 1, 5, "Mag-rus Набор \"Кто где живет? Ассоциации\"", "АНДАНТЕ"], "145": ["Замечательные магниты, хорошо крепятся к холодильнику. Рекомендую.", "2020-10-15T07:52:19Z", "синий, зеленый, красный", "0", 1, 0, 5, "Mag-rus Набор \"Кто где живет? Ассоциации\"", "АНДАНТЕ"], "150": ["Хорошие магнитики! Дочь 1,2 г. заинтересована! На холодильнике держаться очень хорошо-даже дочка сама не может сразу снять, нужно приложить усилия. Красивые картинки, яркие, хорошее художественное исполнение! Спасибо производителю! И магазину за быструю доставку!", "2020-09-20T20:36:25Z", "синий, зеленый, красный", "0", 1, 0, 5, "Mag-rus Набор \"Кто где живет? Ассоциации\"", "АНДАНТЕ"], "156": ["Детям очень понравились магниты. Сделаны аккуратно. Яркие. Красочные. Довольно плотные. Большие. На стене, покрашенной магнитно-грифельной красной, держатся отлично. \nПришли хорошо упакованы. Все целое и ровное.", "2020-09-04T13:30:15Z", "синий, зеленый, красный", "0", 2, 0, 5, "Mag-rus Набор \"Кто где живет? Ассоциации\"", "АНДАНТЕ"], "160": ["Магниты замечательные,  понравились", "2020-08-29T10:28:12Z", "синий, зеленый, красный", "0", 0, 1, 5, "Mag-rus Набор \"Кто где живет? Ассоциации\"", "АНДАНТЕ"], "169": ["Сегодня пришёл заказ, при получении в пункте выдачи не стали проверять количество магнитов, заказ был большой! Проверили только крупногабарит.\r\nПришли домой и обнаружили,  что не хватает  5!!! магнитов. Это вообще как???", "2020-07-22T20:43:46.470297771Z", "синий, зеленый, красный", "0", 1, 0, 1, "Mag-rus Набор \"Кто где живет? Ассоциации\"", "АНДАНТЕ"], "172": ["Хороший набор, ребёнок заинтересовался, не падают, не ломкие. Все как в описании, размер, цвет. Рекомендую. Мы заказали несколько из этой серии.Пришли не помятые, ровные, все хватает.", "2020-07-14T13:11:21.574920874Z", "синий, зеленый, красный", "0", 1, 0, 5, "Mag-rus Набор \"Кто где живет? Ассоциации\"", "АНДАНТЕ"], "173": ["Пошла  я как ответственная мать мыть магниты после покупки, так как ребёнок все в рот берет, ну не думала я что изображение это наклееная бумага,  все намокло и отошли края. Ставлю две звезды за качество", "2020-07-05T13:34:19.356976818Z", "синий, зеленый, красный", "0", 2, 11, 2, "Mag-rus Набор \"Кто где живет? Ассоциации\"", "АНДАНТЕ"], "176": ["Пришел заказ в двойной упаковке. Дома распоковав обнаружила что магнитов 23. А не 24 как должно быть. Нет магнитика Слона. То есть потерятся по дороге она не могла в двойной упаковке. Ребенок огорчен.", "2020-06-27T11:40:56.836953351Z", "синий, зеленый, красный", "0", 0, 1, 5, "Mag-rus Набор \"Кто где живет? Ассоциации\"", "АНДАНТЕ"], "179": ["Хорошие ,цветные,яркие ,но для аккуратного пользования", "2020-05-29T16:18:57.528810733Z", "синий, зеленый, красный", "0", 1, 0, 5, "Mag-rus Набор \"Кто где живет? Ассоциации\"", "АНДАНТЕ"], "182": ["Хорошие магниты. ", "2020-05-23T16:48:13.712518627Z", "синий, зеленый, красный", "0", 1, 0, 1, "Mag-rus Набор \"Кто где живет? Ассоциации\"", "АНДАНТЕ"], "187": ["Магниты покупали за 166 рублей. Пока для ребенка 1 год, оставила только зверюшек, всё устроило, сгибаются и стираются картинки, как и писали выше в отзывах", "2020-05-11T12:54:59.183157834Z", "синий, зеленый, красный", "0", 1, 0, 5, "Mag-rus Набор \"Кто где живет? Ассоциации\"", "АНДАНТЕ"], "192": ["Магниты пришли использованые! Изрисованые и понятие, неприятно этот же товар для детей!", "2020-05-08T13:45:40.510256584Z", "синий, зеленый, красный", "0", 1, 0, 1, "Mag-rus Набор \"Кто где живет? Ассоциации\"", "АНДАНТЕ"], "193": ["Отличные магниты, пришли все. Ребенок маленький, пока повесили только животных, нравится снимать и вешать обратно. Заказом довольна, рекомендую к покупке.", "2020-05-06T16:36:00.007893805Z", "синий, зеленый, красный", "0", 1, 0, 5, "Mag-rus Набор \"Кто где живет? Ассоциации\"", "АНДАНТЕ"], "195": ["Очень клевые магнитики,яркие...некоторые пришли мятые,но выправляются очень хорошо", "2020-05-05T11:00:18.196998145Z", "синий, зеленый, красный", "0", 1, 0, 5, "Mag-rus Набор \"Кто где живет? Ассоциации\"", "АНДАНТЕ"], "197": ["Хорошие магниты,заказ пришел за 2 дня,упаковка в отличном состоянии,ребенку понравилось,поучительно!", "2020-05-03T16:21:59.09861666Z", "синий, зеленый, красный", "0", 3, 0, 5, "Mag-rus Набор \"Кто где живет? Ассоциации\"", "АНДАНТЕ"], "203": ["Ну что же они такие все кривые и косые🤦‍♀️ от этого какой- нибудь край торчит и не примагничиваться с одной стороны. Просто нет слов. Задумка магнитов хорошая, но они уж очень тонкие ( ребёнку будет сложно их снимать с холодильника или магнитной доски. Но если они , как умения, все искривлённые, то проблем не будет, ребёнок зацепится за то часть, которая не примагничивается, а немного торчит. В общем, я немного расстроена покупкой.", "2020-04-29T16:46:44.079512348Z", "синий, зеленый, красный", "0", 1, 0, 3, "Mag-rus Набор \"Кто где живет? Ассоциации\"", "АНДАНТЕ"], "211": ["Уже несколько таких версий магнитов, очень хорошие. Качественные", "2020-04-07T17:35:38.871572698Z", "синий, зеленый, красный", "0", 1, 0, 5, "Mag-rus Набор \"Кто где живет? Ассоциации\"", "АНДАНТЕ"], "217": ["Магнитики яркие, интересные и симпатичные. Ребенку очень понравились", "2020-03-30T15:09:07.607250889Z", "синий, зеленый, красный", "0", 1, 0, 5, "Mag-rus Набор \"Кто где живет? Ассоциации\"", "АНДАНТЕ"], "220": ["Покупала за 188 р. Дороже и не стоят. Очень тонкие и хлипкие. Но картинки хорошие, большие, яркие. Ребёнку нравятся.", "2020-03-29T06:21:59.965480503Z", "синий, зеленый, красный", "0", 1, 0, 4, "Mag-rus Набор \"Кто где живет? Ассоциации\"", "АНДАНТЕ"], "222": ["Мега крутые наборы. Ребенку очень понравилось собирать и находить домики для животных. Взяла ещё профессии. Клеятся к холодильнику очень хорошо. Качество магнитов понравилось", "2020-03-27T12:41:48.774187705Z", "синий, зеленый, красный", "0", 1, 0, 5, "Mag-rus Набор \"Кто где живет? Ассоциации\"", "АНДАНТЕ"], "229": ["Красивые, яркие, качественные. Ребёнку 1,4 нравятся. Нам достались за 198, отличная цена! ", "2020-03-13T10:49:24.750672261Z", "синий, зеленый, красный", "0", 1, 0, 5, "Mag-rus Набор \"Кто где живет? Ассоциации\"", "АНДАНТЕ"], "233": ["Прекрасный развивающий набор , но ребёнок расстроился, что не хватает корзинки для кошки(((. Корзинку не доложили в комплект! Очень жаль!", "2020-02-28T18:26:30.33411257Z", "синий, зеленый, красный", "0", 1, 0, 5, "Mag-rus Набор \"Кто где живет? Ассоциации\"", "АНДАНТЕ"], "234": ["Хорошие магниты! Ребёнок заинтересовался!", "2020-02-25T11:14:24.339936447Z", "синий, зеленый, красный", "0", 1, 0, 5, "Mag-rus Набор \"Кто где живет? Ассоциации\"", "АНДАНТЕ"], "244": ["Очень классные магнитики, единственное некоторые не совсем ровные, но можно положить в книгу и они выпрямятся ", "2020-02-15T10:33:42.890556934Z", "синий, зеленый, красный", "0", 1, 0, 5, "Mag-rus Набор \"Кто где живет? Ассоциации\"", "АНДАНТЕ"], "245": ["Очень классные магнитики!)", "2020-02-13T14:16:12.941605623Z", "синий, зеленый, красный", "0", 1, 0, 5, "Mag-rus Набор \"Кто где живет? Ассоциации\"", "АНДАНТЕ"], "248": ["Упаковка не повреждена, магниты тоже. Картинки яркие. Отличный товар!", "2020-02-11T09:47:45.338749592Z", "синий, зеленый, красный", "0", 1, 0, 5, "Mag-rus Набор \"Кто где живет? Ассоциации\"", "АНДАНТЕ"], "251": ["Не хватает лягушки ", "2020-02-07T20:04:42.377392013Z", "синий, зеленый, красный", "0", 1, 0, 1, "Mag-rus Набор \"Кто где живет? Ассоциации\"", "АНДАНТЕ"], "255": ["Все пришло целое в заводской упаковке! Брала на подарок.", "2020-02-05T10:04:39.896209698Z", "синий, зеленый, красный", "0", 1, 0, 5, "Mag-rus Набор \"Кто где живет? Ассоциации\"", "АНДАНТЕ"], "257": ["Качество хорошее , яркие. Но ! Дома обнаружила дефект... ", "2020-02-04T08:43:22.19233775Z", "синий, зеленый, красный", "0", 0, 2, 3, "Mag-rus Набор \"Кто где живет? Ассоциации\"", "АНДАНТЕ"], "261": ["Классные магниты, яркие, сыну 1.6, с интересом наблюдает и начинает соотносить кто где живёт, рекомендую", "2020-01-30T18:37:10.524757413Z", "синий, зеленый, красный", "0", 2, 0, 5, "Mag-rus Набор \"Кто где живет? Ассоциации\"", "АНДАНТЕ"], "262": ["Отличные магнитики, красочные и интересные, ребенка в 11месяцев заинтересовали, разглядывает по долгу их.", "2020-01-29T13:17:34.239482622Z", "синий, зеленый, красный", "0", 1, 0, 5, "Mag-rus Набор \"Кто где живет? Ассоциации\"", "АНДАНТЕ"], "263": ["При открывании упаковки выяснилось, что одной детали не хватает: скворечника. Проверить, не раскрыв упаковку,не возможно. Поэтому ставлю одну звезду", "2020-01-29T12:26:11.378389504Z", "синий, зеленый, красный", "0", 1, 1, 1, "Mag-rus Набор \"Кто где живет? Ассоциации\"", "АНДАНТЕ"], "267": ["Сами магниты интересные,красочные и милые животные.Один минус-немного деформированы,поэтому приходилось выправлять большую часть магнитов вручную.Два магнита были немного продавлены.Но,считаю,что данный недостаток не критичен-пару недель игры с ними ребёнка и результат будет тот же.", "2020-01-24T19:15:28.011790124Z", "синий, зеленый, красный", "0", 1, 0, 4, "Mag-rus Набор \"Кто где живет? Ассоциации\"", "АНДАНТЕ"], "277": ["Заказала 3 вида магнитов 10 марта. 11 марта доставили только 2, этот набор, как было написано -,,в пути\". А 13 -го я оказывается отказалась от покупки. Это как?", "2019-03-13T07:25:24.329211597Z", "синий, зеленый, красный", "0", 1, 0, 1, "Mag-rus Набор \"Кто где живет? Ассоциации\"", "АНДАНТЕ"], "279": ["Магниты отличные, всё на месте, брали сразу три набора, овощи , кто что ест и кто где живёт.", "2020-01-07T16:27:42.854667063Z", "синий, зеленый, красный", "0", 0, 1, 5, "Mag-rus Набор \"Кто где живет? Ассоциации\"", "АНДАНТЕ"], "284": ["Спасибо огромное, очень довольно покупкой, дочке 10 месяцев, очень нравится из снимать. Самое главное радует то что они не картонные, так как все тянем в рот. ", "2019-12-29T13:42:32.066266942Z", "синий, зеленый, красный", "0", 1, 0, 5, "Mag-rus Набор \"Кто где живет? Ассоциации\"", "АНДАНТЕ"], "287": ["Хорошие магниты за небольшие деньги! Держатся на холодильнике отлично. Некоторые слегка помяты, что для меня не критично. Ребёнку нравятся!", "2019-12-16T20:58:55.307742626Z", "синий, зеленый, красный", "0", 1, 0, 5, "Mag-rus Набор \"Кто где живет? Ассоциации\"", "АНДАНТЕ"], "289": ["Покупала для игры на доске арт 7208061. Магнитики небольшие, но их много, все еле еле влезли на доску. Малышу в 1.4 года интересно их клеить, в руку помещаются хорошо", "2019-12-12T16:45:18.590244226Z", "синий, зеленый, красный", "0", 2, 0, 5, "Mag-rus Набор \"Кто где живет? Ассоциации\"", "АНДАНТЕ"], "291": ["Хорошие магнитные \"пазлы\", удобно вешать на холодильник. Пока готовишь, ребенок -занят какое то время", "2019-12-10T06:22:52.46378799Z", "синий, зеленый, красный", "0", 1, 0, 5, "Mag-rus Набор \"Кто где живет? Ассоциации\"", "АНДАНТЕ"], "308": ["Хорошие магниты))) ", "2019-11-13T13:44:06.834241739Z", "синий, зеленый, красный", "0", 1, 0, 5, "Mag-rus Набор \"Кто где живет? Ассоциации\"", "АНДАНТЕ"], "309": ["Очень хорошие магнитики. Это уже второй набор. Ребёнку 1.6. Играет с интересом. Планирую покупать и другие магнитики этой серии.", "2019-11-13T11:08:12.696275649Z", "синий, зеленый, красный", "0", 1, 0, 5, "Mag-rus Набор \"Кто где живет? Ассоциации\"", "АНДАНТЕ"], "318": ["Магниты хорошего качества, яркие, держатся хорошо", "2019-10-28T10:31:40.873775543Z", "синий, зеленый, красный", "0", 0, 1, 5, "Mag-rus Набор \"Кто где живет? Ассоциации\"", "АНДАНТЕ"], "321": ["Суперические! Качественные, картинки, хоть и рисованные, но очень приятные. Крепятся к холодильнику на ура!", "2019-10-10T11:00:30.99814023Z", "синий, зеленый, красный", "0", 2, 0, 5, "Mag-rus Набор \"Кто где живет? Ассоциации\"", "АНДАНТЕ"], "322": ["Всем советую, очень интересно ребенку и развивается в нужную сторону.", "2019-10-08T10:08:12.900919505Z", "синий, зеленый, красный", "0", 2, 0, 5, "Mag-rus Набор \"Кто где живет? Ассоциации\"", "АНДАНТЕ"], "323": ["Отличные магниты! Они действительно мягкие, легко сломать и оторвать картинку. Но ребёнок в восторге, покупаем уже 2 набор, удобно изучать животных и предметы. А за такие деньги, сломанные магниты и выкинуть не жалко. Спасибо производителю за товар!", "2019-09-26T12:34:01.424382083Z", "синий, зеленый, красный", "0", 2, 0, 5, "Mag-rus Набор \"Кто где живет? Ассоциации\"", "АНДАНТЕ"], "324": ["Магниты понравились, ребенок 2,3 г. часто с ними играет. Но один магнит (скворечник) был с оторванным уголком. Т.е. у нас \"оречник\", вместо \"скворечник\". За это снимаю звезду. Не понимаю как такое могло произойти в запакованном пакете, который при покупке не проверишь. Это испортило впечатление, но возвращать не стала.", "2019-09-03T14:02:52.759213488Z", "синий, зеленый, красный", "0", 0, 1, 4, "Mag-rus Набор \"Кто где живет? Ассоциации\"", "АНДАНТЕ"], "326": ["Хорошие магнитики ) ", "2019-05-26T12:31:51.336297188Z", "синий, зеленый, красный", "0", 1, 1, 5, "Mag-rus Набор \"Кто где живет? Ассоциации\"", "АНДАНТЕ"], "330": ["Картинки хорошие, яркие, четкие, магнитятся к доске нормально. Купили ребёнку около двух лет, собрала быстро и интерес пропал тоже быстро:) наверно нужно и можно пораньше предложить", "2019-08-10T14:35:59.492794511Z", "синий, зеленый, красный", "0", 2, 0, 5, "Mag-rus Набор \"Кто где живет? Ассоциации\"", "АНДАНТЕ"], "331": ["Хорошие магниты!", "2019-08-06T11:35:21.309947533Z", "синий, зеленый, красный", "0", 0, 1, 5, "Mag-rus Набор \"Кто где живет? Ассоциации\"", "АНДАНТЕ"], "334": ["Я думала, они будут побольше все таки. Но за свою цену неплохо.", "2019-08-02T15:53:33.447090177Z", "синий, зеленый, красный", "0", 0, 1, 4, "Mag-rus Набор \"Кто где живет? Ассоциации\"", "АНДАНТЕ"], "337": ["Выкупила все,что было,сейчас ещё предметы одежды идут.Я в них влюбилась и ребенок тоже(возраст 1,11)можно придумать много игр и развивашек с ними.Спасибо-они чудо!", "2019-07-25T13:31:42.802298188Z", "синий, зеленый, красный", "0", 1, 0, 5, "Mag-rus Набор \"Кто где живет? Ассоциации\"", "АНДАНТЕ"], "338": ["Магниты отличные, ребенку 2-х лет отлично зашло. Но ошибки в изображении - у паука 6 ног, у пчелы - 4.  Для 2-х летки не критично, для детей постарше уже потребуются пояснения.", "2019-07-23T20:20:47.993855907Z", "синий, зеленый, красный", "0", 1, 0, 4, "Mag-rus Набор \"Кто где живет? Ассоциации\"", "АНДАНТЕ"], "340": ["Трехлетке на раз. Более не интересно. У местного паука изображено 6 ног. Ребёнок и я в недоумении", "2019-07-20T12:15:01.501651813Z", "синий, зеленый, красный", "0", 1, 0, 3, "Mag-rus Набор \"Кто где живет? Ассоциации\"", "АНДАНТЕ"], "348": ["Ребёнку очень понравились )", "2019-05-22T20:42:08.856595713Z", "синий, зеленый, красный", "0", 0, 1, 5, "Mag-rus Набор \"Кто где живет? Ассоциации\"", "АНДАНТЕ"], "353": ["Хорошие магниты яркие и понятные рисунки ,единственное когда ребёнок намочил магнитик рисунок стал отходить пришлось все обклеить скотчем !", "2019-05-01T08:52:53.704672891Z", "синий, зеленый, красный", "0", 3, 0, 4, "Mag-rus Набор \"Кто где живет? Ассоциации\"", "АНДАНТЕ"], "361": ["Всё отлично но,для собаки и пчёлки домика нету.", "2019-03-28T13:13:37.91439747Z", "синий, зеленый, красный", "0", 1, 0, 4, "Mag-rus Набор \"Кто где живет? Ассоциации\"", "АНДАНТЕ"], "362": ["Магниты понравились. Яркие, крупные, легкие, держаться хорошо. ", "2019-03-25T11:57:46.630768049Z", "синий, зеленый, красный", "0", 1, 0, 5, "Mag-rus Набор \"Кто где живет? Ассоциации\"", "АНДАНТЕ"], "369": ["Магниты очень яркие красивые. Думаю, что качественные, а главное ребенку понравились ", "2019-01-22T18:01:32.707914776Z", "синий, зеленый, красный", "0", 0, 1, 5, "Mag-rus Набор \"Кто где живет? Ассоциации\"", "АНДАНТЕ"], "379": ["Неплохие магниты. Мягкие. Наедине с годовалым ребенком оставить нельзя, порвет", "2018-12-08T15:42:15.620410188Z", "синий, зеленый, красный", "0", 1, 0, 5, "Mag-rus Набор \"Кто где живет? Ассоциации\"", "АНДАНТЕ"], "383": ["Хорошие, но хотелось бы покрупнее", "2018-11-19T12:28:36.557788542Z", "синий, зеленый, красный", "0", 13, 0, 5, "Mag-rus Набор \"Кто где живет? Ассоциации\"", "АНДАНТЕ"], "385": ["Набор может и неплохой, но воробей назван скворцом и поселён в скворечник. Не знаю, хорошо это или плохо: Лягушка с накрашенными губами, румянами и бусами", "2018-11-14T18:16:09.571425025Z", "синий, зеленый, красный", "0", 1, 0, 4, "Mag-rus Набор \"Кто где живет? Ассоциации\"", "АНДАНТЕ"], "386": ["Ребёнку понравились ", "2018-11-09T12:42:20.881995887Z", "синий, зеленый, красный", "0", 2, 0, 5, "Mag-rus Набор \"Кто где живет? Ассоциации\"", "АНДАНТЕ"], "395": ["Магниты замечательные!!! Брала для двухголовой дочери. А в итоге всю серию взяли на садовскую группу! И для развития хорошо. Малыши думают, мелкая моторика работает... Узнают что-то новое. Например, по пустыню и верблюда 😁", "2018-10-08T13:18:03.390356778Z", "синий, зеленый, красный", "0", 1, 0, 5, "Mag-rus Набор \"Кто где живет? Ассоциации\"", "АНДАНТЕ"], "404": ["Магниты замечательные, яркие, красочные, из за упаковки некоторые выгнуты - но это легко исправляется путём обратного загибания 😊 Брала сразу три набора по 174р 😊 Очень довольны 😊", "2018-02-27T08:10:21.262+03:00", "синий, зеленый, красный", "0", 12, 1, 5, "Mag-rus Набор \"Кто где живет? Ассоциации\"", "АНДАНТЕ"], "406": ["вскрыли упаковку после покупки,а некоторые магниты уже отклеиваются ...", "2018-02-16T16:07:53.009+03:00", "синий, зеленый, красный", "0", 1, 0, 2, "Mag-rus Набор \"Кто где живет? Ассоциации\"", "АНДАНТЕ"], "407": ["Отличный набор. магниты тонкие, заламинированные. И, в отличие от магнитных наборов десятого королевства и влади тойс, не склонны протираться, а также могут выдержать незапланированное кратковременное пребывание во рту у ребенка. Из сомнительного: слоны- я бы сказала, что они живут в саванне, а не в джунглях (хотя и там они бывают).", "2018-02-05T13:45:29.796+03:00", "синий, зеленый, красный", "0", 10, 1, 5, "Mag-rus Набор \"Кто где живет? Ассоциации\"", "АНДАНТЕ"], "409": ["ребенку(1,7) очень понравились магниты!!!", "2018-02-02T02:00:48.348+03:00", "синий, зеленый, красный", "0", 1, 0, 5, "Mag-rus Набор \"Кто где живет? Ассоциации\"", "АНДАНТЕ"], "411": ["Магниты шикарные,мягкие.сверху наклеяна гладкая бумага.сыну 3 года в восторге", "2017-12-17T01:23:35.373+03:00", "синий, зеленый, красный", "0", 1, 0, 5, "Mag-rus Набор \"Кто где живет? Ассоциации\"", "АНДАНТЕ"], "413": ["В наборе не хватило белого медведя, обидно, но все равно оставили, так как набор хороший! ", "2017-11-04T13:54:31.702+03:00", "синий, зеленый, красный", "0", 1, 0, 5, "Mag-rus Набор \"Кто где живет? Ассоциации\"", "АНДАНТЕ"], "415": ["Пришли деформированные. Яркие. Достаточно большие. На холодильнике держатся. Ребенок рассматривает. Нравится.", "2017-10-29T13:05:22.849+03:00", "синий, зеленый, красный", "0", 1, 0, 5, "Mag-rus Набор \"Кто где живет? Ассоциации\"", "АНДАНТЕ"], "416": ["Запаха нет. Но, пришлось выгибать(", "2017-10-29T13:06:24.437+03:00", "синий, зеленый, красный", "0", 1, 0, 5, "Mag-rus Набор \"Кто где живет? Ассоциации\"", "АНДАНТЕ"], "417": ["Очень хорошие. Оставили.", "2017-10-26T12:26:48.582+03:00", "синий, зеленый, красный", "0", 1, 0, 5, "Mag-rus Набор \"Кто где живет? Ассоциации\"", "АНДАНТЕ"], "418": ["Магниты яркие и хорошие, не толстые, основание магнитное хорошо приклеяно к рисунку, привезли в прозрачном пакете из за этого немного деформировались в обратную сторону,пришлось выгибать, нет запаха, ребенок доволен", "2017-10-17T21:26:40.239+03:00", "синий, зеленый, красный", "0", 2, 0, 5, "Mag-rus Набор \"Кто где живет? Ассоциации\"", "АНДАНТЕ"]}
